function ContactPanel() {
  return(
    <div className="all">
      <div className = "email-resume">
        <a href="https://www.linkedin.com/in/kiet-ho/" target="_blank"><b>Resum√©</b></a>
        <br/>
        <a>hoakiet98@gmail.com</a>
      </div>

      <div className = "professional">
        <a><b>Professional</b></a><br/>
        <a href="https://www.linkedin.com/in/kiet-ho/">LinkedIn</a><br/>
        <a href="https://www.linkedin.com/in/kiet-ho/">GitHub</a><br/>
        <a href="https://www.linkedin.com/in/kiet-ho/">Dribbble</a><br/>
      </div>

      <div className = "social">
        <a><b>Social</b></a><br/>
        <a href="https://www.linkedin.com/in/kiet-ho/">Instagram</a><br/>
        <a href="https://www.linkedin.com/in/kiet-ho/">Facebook</a><br/>
        <a href="https://www.linkedin.com/in/kiet-ho/">Twitter</a><br/>
      </div>

      <style jsx>{`
        font-size: 2vh;
        position:relative;
        line-height: 3vh;
        .all{
          padding-top: 18vh;
        }
        .email-resume{
          text-align: center;
          padding-bottom: 5vh;
        }
        .professional{
          padding-left: 25vw;
          float:left;
        }
        .social{
          padding-right: 25vw;
          float:right;
        }

        `}</style>
    </div>

  )}

export default ContactPanel
